     select TO_NUMBER(:SYNC_SEQUENCE),'2',:TRADE_ID,a.PARTITION_ID,a.USER_ID,a.SERIAL_NUMBER,a.SERIAL_NUMBER_B,a.PRODUCT_MODE,a.PRODUCT_ID,a.PRODUCT_NAME,a.PACKAGE_ID,a.PACKAGE_NAME,a.CAMPN_ID,a.CAMPN_CODE,a.CAMPN_NAME,a.CAMPN_TYPE,a.OPER_FEE,a.FOREGIFT,a.ADVANCE_PAY,a.SCORE_CHANGED,a.CREDIT_VALUE,a.MONTHS,a.END_MODE,a.ACTOR_PSPT_ID,a.ACTOR_PSPT_TYPE_CODE,a.ACTOR_PHONE,a.ACTOR_NAME,a.APPR_STAFF_ID,a.APPR_TIME,a.OUT_NET_PHONE,a.CONTRACT_ID,a.PROCESS_TAG,a.ACCEPT_DATE,a.TRADE_STAFF_ID,a.RELATION_TRADE_ID,a.CANCEL_DATE,a.CANCEL_STAFF_ID,a.CANCEL_CAUSE,a.START_DATE,a.START_DATE - 1/24/3600,a.UPDATE_TIME,a.UPDATE_STAFF_ID,a.UPDATE_DEPART_ID,'删除无效数据',a.RSRV_NUM1,a.RSRV_NUM2,a.RSRV_NUM3,a.RSRV_NUM4,a.RSRV_NUM5,a.RSRV_STR1,a.RSRV_STR2,a.RSRV_STR3,a.RSRV_STR4,a.RSRV_STR5,a.RSRV_STR6,a.RSRV_STR7,a.RSRV_STR8,a.RSRV_STR9,a.RSRV_STR10,a.RSRV_STR11,a.RSRV_STR12,a.RSRV_STR13,a.RSRV_STR14,a.RSRV_STR15,a.RSRV_STR16,a.RSRV_STR17,a.RSRV_STR18,a.RSRV_STR19,a.RSRV_STR20,a.RSRV_STR21,a.RSRV_STR22,a.RSRV_STR23,a.RSRV_STR24,a.RSRV_STR25,a.RSRV_DATE1,a.RSRV_DATE2,a.RSRV_DATE3,a.RSRV_TAG1,a.RSRV_TAG2,a.RSRV_TAG3
       FROM TF_B_TRADE_SALE_ACTIVE_BAK a
      WHERE a.trade_id = :TRADE_ID
        AND a.accept_month = :ACCEPT_MONTH
        AND NOT EXISTS (SELECT 1 FROM TI_B_SALE_ACTIVE
                         WHERE sync_sequence = TO_NUMBER(:SYNC_SEQUENCE)
                           AND a.user_id = user_id
                           AND a.package_id = package_id
                           AND a.product_id = product_id
                           AND a.campn_id = campn_id
                           AND a.relation_trade_id = relation_trade_id
                           AND a.start_date = start_date)